import { useState } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
} from 'react-router-dom';

import Education from './../components/education';
import Projects from './../components/projects';
import About from './../components/about';
import Skills from './../components/skills';
import Resume from './../components/resume';

import './rightCard.css';
import logo from './../logo/call.png';


function RightCard() {
    let [data, setData] = useState("About");
    let [ele, setEle] = useState("About");
    console.log(data);
    return (
        <div className="sub-container-2">
            <Router>
                <div className="nav-bar">
                    <Link
                        className="abt"
                        to="/"
                        onClick={() => {
                            setData("About");
                        }}
                    >{data}
                    </Link>
                    <div>
                        <Link
                            to="/education"
                            onClick={() => {
                                setData("Education");
                            }}
                        >Education
                        </Link>
                        <Link
                            to="/projects"
                            onClick={() => {
                                setData("Projects");
                            }}
                        >Projects
                        </Link>
                        <Link
                            to="/skills"
                            onClick={() => {
                                setData("Skills");
                            }}
                        >Skills
                        </Link>
                        <Link
                            to="/resume"
                            onClick={() => {
                                setData("Resume");
                            }}
                        >Resume
                        </Link>
                    </div>
                </div>
                <>
                    <Switch>
                        <Route exact path="/">
                            <About />
                        </Route>
                        <Route path="/education">
                            <Education />
                        </Route>
                        <Route path="/projects">
                            <Projects />
                        </Route>
                        <Route path="/skills">
                            <Skills />
                        </Route>
                        <Route path="/resume">
                            <Resume />
                        </Route>
                    </Switch>
                </>
            </Router>
        </div>
    );
}

export default RightCard;
